import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Home from './pages/home/home';
import LoginForm from './pages/login/login';

function App() {
  return (
    <Switch>
      <Route path="/" exact><Home /> </Route>
      <Route path="/adminDashboard" ><Home /> </Route>
    </Switch>
  );
}

export default App;
